const readCsvData = async () => {
  const results: any[] = [];

  const stream = fs
    .createReadStream("data.csv")
    .pipe(parse({ delimiter: ",", from_line: 2 }))
    .on("data", (data) => results.push(data));

  await finished(stream);

  return results;
};

const writeDataToCsv = async (data: any[]) => {
  const ws = fs.createWriteStream("data.csv");

  const columsn = ["name", "number", "lat", "long", "address"];
  ws.write(columsn.join(",") + "\n");

  console.log("writing data to csv file >>>>>>>>>>>>>>>>");
  for await (const ele of data) {
    ws.write(ele.join(",") + "\n");
  }
};

const makeCsvDataUnique = async (data: any[]) => {
  const obj: Record<string, any> = {};

  for await (const ele of data) {
    obj[JSON.stringify(ele)] = ele;
  }

  return Object.values(obj);
};

const parseData = async () => {
  const dataToWrite: any[] = [];
  const data = rawData.results.data;

  for await (const ele of data) {
    dataToWrite.push([
      ele[1], //name
      ele[15], //phone
      ele[4] ?? "0", //lat
      ele[5] ?? "0", //long
      `${ele[3] || ele[45]} - ${ele[12]} - ${ele[70].city} - ${ele[18]} - ${
        ele[70].pin
      }`, //address
    ]);
  }

  return dataToWrite;
};

const main = async () => {
  console.clear();

  const startTime = performance.now();

  const parsedData = await parseData();
  const csvData = await readCsvData();
  const uniqueData = await makeCsvDataUnique([...csvData, ...parsedData]);
  await writeDataToCsv(uniqueData);

  const endTime = performance.now();
  console.log("Time Taken: ", endTime - startTime, "ms");
  console.log(" >>>>>>>>>>>>>>>> END <<<<<<<<<<<<<<<<<");
};

main();
